import React from "react";
import { Form, Col, Button, Container, Row, Card } from "react-bootstrap";
import "./Register.styles.css";

const Register = (props) => {
  return (
    <div className="register h-100 d-flex justify-content-center align-items-center">
      <Card className="w-75">
        <Card.Body>
          <Card.Title className="title-register">Create Account</Card.Title>
          <Form className="my-4">
            <Row md={2} sm={1} xs={1}>
              <Col>
                <Form.Group controlId="formBasicEmail">
                  <Form.Label style={{textAlign:"start"}}>Email address</Form.Label>
                  <Form.Control type="email" placeholder="Enter email" />
                </Form.Group>
              </Col>
              <Col>
                <Form.Group controlId="formBasicEmail">
                  <Form.Label>Email address</Form.Label>
                  <Form.Control type="email" placeholder="Enter email" />
                </Form.Group>
              </Col>
            </Row>
          </Form>
        </Card.Body>
      </Card>
    </div>
  );
};

export default Register;
